import React from 'react';
import s from './Home.module.css';

function Home() {
    return (
        <div className={s.home}>
            <br /><br /><br />
            <span id={s.hi}>Hi all, I'm TigranMets</span>
            <br />
            <span className={s.description}>ես 14 տարեկան եմ և ReactJs ծրագրավորող 🚀<span />
                <br /> <span className={s.description}>տիրապետում եմ html css / js / jquery / react -ին </span>
                <br /><span className={s.description}>այժմ սովորում եմ 56 դպրոցում գնում եմ թումո և
                    <br />
                    <span className={s.description}>ինքնուսուցմամբ ծրագրավորում:</span>
                </span>
            </span>
            <br></br>
            <img className={s.socImage} src="https://github.com/opengraph.png" alt="github" />
            <img className={s.socImage} src="https://www.facebook.com/images/fb_icon_325x325.png" alt="facebook" />
            <img className={s.socImage} src="https://upload.wikimedia.org/wikipedia/commons/thumb/a/a5/Instagram_icon.png/1024px-Instagram_icon.png" alt="instagram" />
            <img className={s.socImage} src="https://upload.wikimedia.org/wikipedia/commons/thumb/7/7e/Gmail_icon_%282020%29.svg/1200px-Gmail_icon_%282020%29.svg.png" alt="gmail" />
            <img className={s.socImage} src="data:image/png;base64," alt="yotube" />
        </div>
    );
}

export default Home;
